import React from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Box,
  Container,
  Typography,
  Grid,
  Card,
  CardContent,
  CardMedia,
  Button,
} from '@mui/material';

const categories = [
  {
    id: 1,
    name: 'Telescopes',
    description: 'Discover the cosmos with our premium telescopes',
    image: 'https://images.unsplash.com/photo-1516339901601-2e1b62dc0c45?auto=format&fit=crop&w=500',
    filter: 'Telescopes & Accessories'
  },
  {
    id: 2,
    name: 'Merchandise',
    description: 'Show your love for space with NASA apparel and collectibles',
    image: 'https://images.unsplash.com/photo-1596727147705-61a532a659bd?auto=format&fit=crop&w=500',
    filter: 'Space Merchandise'
  },
  {
    id: 3,
    name: 'Study Materials',
    description: 'Learn about the universe with our educational resources',
    image: 'https://images.unsplash.com/photo-1589487391730-58f20eb2c308?auto=format&fit=crop&w=500',
    filter: 'Books & Education'
  },
  {
    id: 4,
    name: 'Home Decor',
    description: 'Transform your space with cosmic-themed decorations',
    image: 'https://images.unsplash.com/photo-1419242902214-272b3f66ee7a?auto=format&fit=crop&w=500',
    filter: 'Home & Lifestyle'
  },
  {
    id: 5,
    name: 'Space Toys',
    description: 'Educational and fun space toys for all ages',
    image: 'https://images.unsplash.com/photo-1545156521-77bd85671d30?auto=format&fit=crop&w=500',
    filter: 'Gadgets & Kits'
  },
  {
    id: 6,
    name: 'Galaxy Lamps',
    description: 'Bring the stars into your room with our galaxy projectors',
    image: 'https://images.unsplash.com/photo-1534447677768-be436bb09401?auto=format&fit=crop&w=500',
    filter: 'Home & Lifestyle'
  }
];

const Home = () => {
  const navigate = useNavigate();

  const handleCategoryClick = (filter) => {
    navigate('/products', { state: { category: filter } });
  };

  return (
    <Box>
      {/* Hero Section */}
      <Box
        sx={{
          background: 'linear-gradient(rgba(0,0,0,0.7), rgba(0,0,0,0.7)), url(https://images.unsplash.com/photo-1462331940025-496dfbfc7564?auto=format&fit=crop&w=2048&q=80)',
          backgroundSize: 'cover',
          backgroundPosition: 'center',
          height: { xs: '60vh', md: '80vh' },
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          textAlign: 'center',
          mb: 6,
        }}
      >
        <Container>
          <Typography
            variant="h2"
            component="h1"
            sx={{
              color: 'white',
              fontWeight: 700,
              mb: 3,
              textShadow: '2px 2px 4px rgba(0,0,0,0.5)',
            }}
          >
            Explore the Cosmos
          </Typography>
          <Typography
            variant="h5"
            sx={{
              color: 'white',
              mb: 4,
              textShadow: '1px 1px 2px rgba(0,0,0,0.5)',
            }}
          >
            Your One-Stop Shop for All Things Space
          </Typography>
          <Button
            variant="contained"
            size="large"
            onClick={() => navigate('/products')}
            sx={{
              bgcolor: '#7c4dff',
              '&:hover': {
                bgcolor: '#6c3fff',
              },
            }}
          >
            Shop Now
          </Button>
        </Container>
      </Box>

      {/* Categories Section */}
      <Container sx={{ mb: 8 }}>
        <Typography
          variant="h3"
          component="h2"
          sx={{
            textAlign: 'center',
            mb: 6,
            color: 'white',
            fontWeight: 600,
          }}
        >
          Featured Categories
        </Typography>
        <Grid container spacing={4}>
          {categories.map((category) => (
            <Grid item xs={12} sm={6} md={4} key={category.id}>
              <Card
                onClick={() => handleCategoryClick(category.filter)}
                sx={{
                  height: '100%',
                  display: 'flex',
                  flexDirection: 'column',
                  cursor: 'pointer',
                  background: 'rgba(255, 255, 255, 0.1)',
                  backdropFilter: 'blur(10px)',
                  transition: 'transform 0.3s ease-in-out',
                  '&:hover': {
                    transform: 'scale(1.03)',
                  },
                }}
              >
                <CardMedia
                  component="img"
                  height="200"
                  image={category.image}
                  alt={category.name}
                  sx={{ objectFit: 'cover' }}
                />
                <CardContent sx={{ flexGrow: 1, color: 'white' }}>
                  <Typography gutterBottom variant="h5" component="h3">
                    {category.name}
                  </Typography>
                  <Typography variant="body2" sx={{ color: 'rgba(255,255,255,0.8)' }}>
                    {category.description}
                  </Typography>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>
    </Box>
  );
};

export default Home;
